import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<App/>, document.getElementById('root'));

function setup() {
    const header = (<div class="header">
        <h1>Hello, world!</h1>
        <p>This will be our react coffee map app</p>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>);
    const input = (<div class="input">
        <h2>Input stuff is here</h2>
    </div>);

    const list = (<div class="item-list">
        <h2>imported item is here</h2>
    </div>);
    const map = (<div class="google-map">
        <h2>google map is here</h2>
    </div>);

    ReactDOM.render(header, document.getElementById('root'));
    ReactDOM.render(input, document.getElementById('root'));
    ReactDOM.render(list, document.getElementById('root'));
    ReactDOM.render(map, document.getElementById('root'));
}

setup();

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
